        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!
{% endblock %}
{% block stylesheets %}
\t{{ parent() }}
\t<link rel=\"stylesheet\" href=\"{{asset('css/login.css') }}\">
{% endblock %}
{% block body %}

\t<div class=\"container-fluid\">
\t\t<div class=\"abs-center\">

\t\t\t<form id=\"login\" method=\"post\">
\t\t\t\t{% if error %}
\t\t\t\t\t<div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
\t\t\t\t{% endif %}

\t\t\t\t{% if app.user %}
\t\t\t\t\t<div class=\"mb-3\">
\t\t\t\t\t\tEst&aacute;s logueado como
\t\t\t\t\t\t{{ app.user.username }},
\t\t\t\t\t\t<a href=\"{{ path('app_logout') }}\">Logout</a>
\t\t\t\t\t</div>
\t\t\t\t{% endif %}

\t\t\t\t<h1 class=\"h3 mb-3 font-weight-normal\">Por favor, registrese</h1>
\t\t\t\t<label for=\"inputUsername\">Usuario</label>
\t\t\t\t<input type=\"text\" value=\"{{ last_username }}\" name=\"username\" id=\"inputUsername\" class=\"form-control m-auto rounded-pill\" required autofocus>
\t\t\t\t<label for=\"inputPassword\">Contrase&ntilde;a</label>
\t\t\t\t<input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control m-auto rounded-pill\" required>

\t\t\t\t<input
\t\t\t\ttype=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">

\t\t\t\t{#
\t\t\t\t                Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
